#Creem la base de dades
CREATE DATABASE meteo;
USE meteo;

#Creem la taula en base a:

DROP TABLE IF EXISTS meteo;
CREATE TABLE meteo (
  id INT NOT NULL AUTO_INCREMENT,
  date DATETIME,
  hour INT,
  temp FLOAT,
  humidity FLOAT,
  precip FLOAT,
  windspeed FLOAT,
  winddir FLOAT,
  PRIMARY KEY (id)
);




